import React from "react";

const SubForm = ()=>{
    return(
        <div className="sub-form-container">
            <div className="sub-form-content">
                <h1>Review</h1><br />
                <textarea rows="10" cols="30" placeholder="Any Suggestions for website..."/><br />
                <button>Submit</button>
            </div>
        </div>
    )
}

export default SubForm;
